import React from 'react';

function Articles({ match }) {
    const name = match.params.name;
  return (
    <>
    <pre>
    {JSON.stringify(match.params.name, null, 4)}
    </pre>
    <h1>This Article is {JSON.stringify(match, null, 4)} </h1>

    </>
  )
}

export default Articles;
